// Home.js
import React from "react";
import Navbar from "./Navbar"; // Import Navbar component

function Home() {
    return (
        <div>
            {/* Render Navbar component */}
            <Navbar authenticated={false} /> {/* Pass appropriate authenticated prop value */}
            <h1>This is the Homepage</h1>
        </div>
    );
}

export default Home;
